import React from "react";
import "./styles/styles.css";

import Navbar from "./components/Navbar";
import HeroBanner from "./components/HeroBanner";
import Features from "./components/Features";
import Services from "./components/Services";
import Pricing from "./components/Pricing";
import Download from "./components/Download";
import Footer from "./components/Footer";

export default function App() {
  return (
    <>
      <Navbar />
      <main>
        <HeroBanner />
        <div style={{ width: "100%", height: "500px", backgroundColor: "#fffbcc", display: "flex", flexDirection: "column", justifyContent: "center", alignItems: "center" }}>
          <iframe style={{ padding: "24px" }} width="560" height="315" src="https://www.youtube.com/embed/eBCmgUL-Me8" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
        <Features />
        <Services />
        <Pricing />
        <Download />
      </main>
      <Footer />
    </>
  );
}
